<script>
import { required, minLength, between } from "vuelidate/lib/validators";

export default {
    data() {
        return {
            isDisabled: true,
            check2: false,
            type: `text`,
            userAuth: null,
            isError: {
                is: false,
                text: {
                    uz: "Parol noto'g'ri!",
                    ru: "Неверный пароль!"
                }
            },
            isCompare: {
                is: false,
                text: {
                    uz: "Parolni tasdiqlang!",
                    ru: "Подтвердите пароль!"
                }
            },
            user: {
                password: "",
                newPassword: "",
                confirmPassword: ""
            }
        };
    },
    validations: {
        user: {
            newPassword: {
                required,
                minLength: minLength(6)
            },
            confirmPassword: {
                required,
                minLength: minLength(6)
            }
        }
    },
    async mounted() {
        this.userAuth = this.$auth.user;
    },
    methods: {
        showPassword() {
            if (this.type === `password`) {
                this.type = `text`;
            } else {
                this.type = `password`;
            }
        },
        checkPassword() {
            if (this.user.password.length > 0) {
                this.$axios
                    .$post("/user/check", {
                        password: this.user.password
                    })
                    .then(res => {
                        if (res.success) {
                            this.isDisabled = false;
                            this.isError.is = false;
                        } else {
                            this.isError.is = true;
                            this.isDisabled = true;
                        }
                    });
            }
        },
        updatePassword() {
            this.$v.user.$touch();
            this.check2 = true;

            if (!this.$v.user.$invalid) {
                if (this.user.newPassword == this.user.confirmPassword) {
                    this.$axios
                        .$put("/user/edit/password", {
                            password: this.user.newPassword
                        })
                        .then(res => {
                            if (res.success) {
                                this.$router.push({
                                    name: `profile___${this.$i18n.locale}`
                                });
                            }
                        });
                } else {
                    this.isCompare.is = true;
                }
            }
        }
    }
};
</script>

